import React from "react";
import { Route } from "react-router-dom";

//Home 화면 import
import Title from "./Title";
import Home from "./Home";
import Detail from "./Detail";

function App() {
  return (
    <div className="App">
      <Route path="/" exact>
        <Title />
        <Home />
      </Route>
      <Route path="/word/add" exact>
        <Detail />
        <Home />
      </Route>
    </div>
  );
}

export default App;
